INSERT INTO `1668940036_wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES (1,1,'2020-06-13 14:16:56','2020-06-13 14:16:56','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2020-06-13 14:16:56','2020-06-13 14:16:56','',0,'http://lqustg.wpengine.com/?p=1',0,'post','',1),(3,1,'2020-06-13 14:16:56','2020-06-13 14:16:56','<!-- wp:heading -->\r\n<h2><!-- wp:heading --></h2>\r\n<h2><!-- wp:heading --></h2>\r\n<h2>Who we are</h2>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>Our website address is: http://lqustg.wpengine.com</p>\r\n<p>This Privacy Policy describes how your personal information is collected, used, and shared when you visit or make a purchase or inquiry from lqustg.wpengine.com (the “Site”).</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading --></h2>\r\n<h2>What personal data we collect</h2>\r\n<p>When you visit the Site, we automatically collect certain information about your device, including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device. Additionally, as you browse the Site, we collect information about the individual web pages or products that you view, what websites or search terms referred you to the Site, and information about how you interact with the Site. We refer to this automatically collected information as “Device Information.”</p>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --></h2>\r\n<p>We collect Device Information using the following technologies:</p>\r\n<h3>Cookies</h3>\r\n<p>“Cookies” are data files that are placed on your device or computer and often include an anonymous unique identifier. For more information about cookies, and how to disable cookies, visit http://www.allaboutcookies.org.</p>\r\n<h3>Log Files</h3>\r\n<p>    - “Log files” track actions occurring on the Site, and collect data including your IP address, browser type, Internet service provider, referring/exit pages, and date/time stamps.</p>\r\n<h3>Web beacon, tags, and pixels</h3>\r\n<p>    - “Web beacons,” “tags,” and “pixels” are electronic files used to record information about how you browse the Site.</p>\r\n<p>&nbsp;</p>\r\n<p>Additionally, when you make a purchase or attempt to make a purchase through the Site, we collect certain information from you, including your name, billing address, shipping address, payment information, email address, and phone number.  We refer to this information as “Order Information.”</p>\r\n<p>When we talk about “Personal Information” in this Privacy Policy, we are talking both about Device Information and Order Information.</p>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading {\"level\":3} --></h2>\r\n<h3>Analytics</h3>\r\n<p>We use Google Analytics to help us understand how our customers use the Site--you can read more about how Google uses your Personal Information here: https://www.google.com/intl/en/policies/privacy/. You can also opt-out of Google Analytics here: https://tools.google.com/dlpage/gaoptout.</p>\r\n<h2>How do we use your data</h2>\r\n<p>We use the Order Information that we collect generally to fulfill any orders placed through the Site (including processing your payment information, arranging for shipping, and providing you with invoices and/or order confirmations).  Additionally, we use this Order Information to:</p>\r\n<p>Communicate with you;</p>\r\n<p>Screen our orders for potential risk or fraud; and</p>\r\n<p>When in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.</p>\r\n<p>We use the Device Information that we collect to help us screen for potential risk and fraud (in particular, your IP address), and more generally to improve and optimize our Site (for example, by generating analytics about how our customers browse and interact with the Site, and to assess the success of our marketing and advertising campaigns).</p>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading --></h2>\r\n<h2>Who we share your data with</h2>\r\n<p>We share your Personal Information with third parties to help us use your Personal Information, as described above.</p>\r\n<p>Finally, we may also share your Personal Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful request for information we receive, or to otherwise protect our rights.</p>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading --></h2>\r\n<h2>How long we retain your data</h2>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>Content you provide is retained indefinitely.</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading --></h2>\r\n<h2>What rights you have over your data</h2>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph --></h2>\r\n<p>If you are a European resident, you have the right to access personal information we hold about you and to ask that your personal information be corrected, updated, or deleted. If you would like to exercise this right, please contact us through the contact information below.</p>\r\n<p>Additionally, if you are a European resident we note that we are processing your information in order to fulfill contracts we might have with you (for example if you make an order through the Site), or otherwise to pursue our legitimate business interests listed above.  Additionally, please note that your information will be transferred outside of Europe, including to Canada and the United States.</p>\r\n<h3>Do not track</h3>\r\n<p>Please note that we do not alter our Site’s data collection and use practices when we see a Do Not Track signal from your browser.</p>\r\n<h2><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading --><!-- /wp:paragraph -->\r\n\r\n<!-- wp:heading --><!-- /wp:heading -->\r\n\r\n<!-- wp:heading --></h2>\r\n<h2>Additional information</h2>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --></h2>\r\n<h3>Changes</h3>\r\n<p>We may update this privacy policy from time to time in order to reflect, for example, changes to our practices or for other operational, legal or regulatory reasons.</p>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --></h2>\r\n<h3>Contact us</h3>\r\n<p>For more information about our privacy practices, if you have questions, or if you would like to make a complaint, please contact us by e-mail at info@lqupholstery.com or by mail using the details provided below:</p>\r\n<p>948 Jamaica Ave, Brooklyn, NY, 11208, United States</p>\r\n<h2><!-- /wp:heading -->\r\n\r\n<!-- wp:heading {\"level\":3} --><!-- /wp:heading --></h2>\r\n<!-- /wp:heading -->','Privacy Policy','','publish','closed','open','','privacy-policy','','','2020-09-09 16:37:27','2020-09-09 20:37:27','',0,'http://lqustg.wpengine.com/?page_id=3',0,'page','',0),(5,1,'2020-08-03 12:31:01','2020-08-03 16:31:01','[et_pb_section admin_label=\"section\"]\n			[et_pb_row admin_label=\"row\"]\n				[et_pb_column type=\"4_4\"][et_pb_text admin_label=\"Text\"]<!-- wp:paragraph -->\r\n<p>Test</p>\r\n<!-- /wp:paragraph -->[/et_pb_text][/et_pb_column]\n			[/et_pb_row]\n		[/et_pb_section]','Home','','publish','closed','closed','','home','','','2022-11-06 15:49:11','2022-11-06 20:49:11','',0,'http://lqustg.wpengine.com/?page_id=5',0,'page','',0),(7,1,'2020-08-03 21:59:02','2020-08-04 01:59:02','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:4:\"page\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:1:\"5\";}}}s:8:\"position\";s:15:\"acf_after_title\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:6:{i:0;s:11:\"the_content\";i:1;s:10:\"discussion\";i:2;s:8:\"comments\";i:3;s:4:\"slug\";i:4;s:6:\"author\";i:5;s:15:\"page_attributes\";}s:11:\"description\";s:0:\"\";}','Home